    "contracts/V2/StanNFTV2.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity 0.8.4;

import "erc721a/contracts/ERC721A.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/IERC721ReceiverUpgradeable.sol";
import "../interfaces/ICollectionNFT.sol";
import "../interfaces/IStanFund.sol";
import "../interfaces/IConfig.sol";
import "../library/AuctionLibrary.sol";
import "../library/AuctionStructure.sol";

contract StanNFTV2 is ERC721A {
    ICollectionNFT private collectionNFT;
    address public auctionAddress;
    address public owner;
    mapping(address => bool) private whiteList;
    mapping(uint256 => uint256) private TokenIdToPrice;
    mapping(uint256 => bytes) private TokenIdToListing;
    bytes constant NULL = "";
    IStanFund public stanFund;
    IConfig public config;
    bytes public baseURI;

    event STAN_EVENT(
        bytes requestId,
        AuctionLibrary.FunctionName nameFunction,
        bool platform,
        uint256 tokenId,
        bytes nftIds
    );

    event STAN_TX(
        bytes requestId,
        AuctionLibrary.FunctionName nameFunction,
        uint256 royalty,
        uint256 stanFee,
        uint256 exchangeWeb
    );

    event MOVE_BATCH_NFT_STAN_EVENT(
        bytes requestId,
        AuctionLibrary.FunctionName nameFunction,
        bool platform,
        uint256 tokenId
    );

    modifier onlyAuthorizerAndOwner(uint256 _tokenId) {
        require(
            whiteList[msg.sender] || ownerOf(_tokenId) == msg.sender,
            "InvalidOwner"
        );
        _;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "InvalidOwner");
        _;
    }

    function initialize(address _config) public initializer {
        ERC721A.initialize("Stan", "STAN");
        owner = msg.sender;
        config = IConfig(_config);
    }

    function setStanFund(address _stanFundAddress) external onlyOwner {
        stanFund = IStanFund(_stanFundAddress);
    }

    function setConfig(address _config) external onlyOwner {
        config = IConfig(_config);
    }

    function setCollectionNFT(
        address _collectionNFTAdrress
    ) external onlyOwner {
        collectionNFT = ICollectionNFT(_collectionNFTAdrress);
    }

    function setAuthorizers(
        address[] calldata _caller,
        bool _allowed
    ) external onlyOwner {
        for (uint256 i = 0; i < _caller.length; ) {
            whiteList[_caller[i]] = _allowed;
            unchecked {
                ++i;
            }
        }
    }

    function _checkOwnerNFTs(
        uint256[] calldata tokenIds,
        address _implementor
    ) internal view returns (bool) {
        for (uint256 i = 0; i < tokenIds.length; ) {
            if (ownerOf(tokenIds[i]) != _implementor) return false;
            unchecked {
                ++i;
            }
        }

        return true;
    }

    function moveBatchNFTToCollection(
        bytes calldata _requestId,
        bytes calldata _oldIdCollection,
        bytes calldata _newIdCollection,
        address _creator,
        uint256 _quantity,
        uint256[] calldata _tokenIds,
        bool _isWeb
    ) external {
        address maker = (msg.sender == owner) ? _creator : msg.sender;
        require(_checkOwnerNFTs(_tokenIds, maker), "InvalidOwnerNFT");

        collectionNFT.processAddingBatchtoCollection(
            _oldIdCollection,
            _newIdCollection,
            maker,
            _quantity,
            _tokenIds
        );

        emit MOVE_BATCH_NFT_STAN_EVENT(
            _requestId,
            AuctionLibrary.FunctionName.MOVE_BATCH_NFT,
            _isWeb,
            0
        );
    }

    function createNFTByStan(
        bytes calldata _requestId,
        bytes calldata _collectionId,
        uint256 _quantity,
        address _to,
        bool _isWeb
    ) external onlyOwner {
        _mintERC2309(_to, _quantity);
        collectionNFT.addBatchNFTToCollection(
            _collectionId,
            _to,
            _nextTokenId(),
            _quantity
        );

        emit STAN_EVENT(
            _requestId,
            AuctionLibrary.FunctionName.CREATE_NFT,
            _isWeb,
            _nextTokenId(),
            NULL
        );
    }

    function createNFT(
        bytes calldata _requestId,
        bytes calldata _collectionId,
        uint256 _quantity,
        bytes calldata _nftIds,
        bool _isWeb
    ) external {
        _mintERC2309(msg.sender, _quantity);
        collectionNFT.addBatchNFTToCollection(
            _collectionId,
            msg.sender,
            _nextTokenId(),
            _quantity
        );

        stanFund.set(
            config.getFeeStanFixed().feeMintingNFT,
            AuctionStructure.Operator.MINUS,
            msg.sender
        );

        stanFund.setSupply(
            config.getFeeStanFixed().feeMintingNFT,
            AuctionStructure.Operator.MINUS
        );

        emit STAN_TX(
            _requestId,
            AuctionLibrary.FunctionName.CREATE_NFT,
            0,
            config.getFeeStanFixed().feeMintingNFT,
            0
        );

        emit STAN_EVENT(
            _requestId,
            AuctionLibrary.FunctionName.CREATE_NFT,
            _isWeb,
            _nextTokenId(),
            _nftIds
        );
    }

    function getTokenToListing(
        uint256 _tokenId
    ) external view returns (bytes memory) {
        return TokenIdToListing[_tokenId];
    }

    function updateTokenToListing(
        bytes calldata _listing,
        uint256 _tokenId
    ) external onlyAuthorizerAndOwner(_tokenId) {
        TokenIdToListing[_tokenId] = _listing;
    }

    function setPriceNFT(
        uint256 _tokenId,
        uint256 _amount
    ) external onlyAuthorizerAndOwner(_tokenId) {
        TokenIdToPrice[_tokenId] = _amount;
    }

    function getPriceNFT(uint256 _tokenId) external view returns (uint256) {
        return TokenIdToPrice[_tokenId];
    }

    function updateOwnerNFTAndTransferNFT(
        address _from,
        address _to,
        uint256 _tokenId
    ) external onlyAuthorizerAndOwner(_tokenId) {
        collectionNFT.updateOwnerNFT(
            collectionNFT.getTokenIdToCollectionId(_tokenId),
            _from,
            _to
        );

        safeTransferFrom(_from, _to, _tokenId);
    }

    function approveForAll(
        address _auctionFixedPrice,
        address _auctionPure,
        bool _approved
    ) external {
        setApprovalForAll(_auctionFixedPrice, _approved);
        setApprovalForAll(_auctionPure, _approved);
    }

    function approveForAuction(
        address _owner,
        address[] calldata _operators,
        bool _approved
    ) external onlyOwner {
        for (uint256 i = 0; i < _operators.length; ) {
            _setApprovalForAll(_owner, _operators[i], _approved);
            unchecked {
                ++i;
            }
        }
    }

    function _startTokenId() internal pure override returns (uint256) {
        return 1;
    }

    function onERC721Received(
        address operator,
        address from,
        uint256 tokenId,
        bytes calldata data
    ) external view returns (bytes4) {
        return this.onERC721Received.selector;
    }

    function getIsApprovedForAll(
        address _owner,
        address _operator
    ) external view returns (bool) {
        return isApprovedForAll(_owner, _operator);
    }
}
"
    },
